static Jpeg2000TgtNode *ff_jpeg2000_tag_tree_init(int w, int h)

{

    int pw = w, ph = h;

    Jpeg2000TgtNode *res, *t, *t2;

    int32_t tt_size;



    tt_size = tag_tree_size(w, h);

    if (tt_size == -1)

        return NULL;



    t = res = av_mallocz_array(tt_size, sizeof(*t));

    if (!res)

        return NULL;



    while (w > 1 || h > 1) {

        int i, j;

